import React, {Component} from 'react';
import CardList from './CardList';
import {robots} from './Robots';
import Seacrhbox from './Searchbox'

class App extends Component {
	render(){
		return(
		<div>
			<h1> Robots </h1>
			<Seacrhbox />
			<CardList robots={robots}/>
		</div>
	);

	}
}



export default App;
